
import math
def recover_from_e(N,e,d):
	ed_minus_1 = e*d -1
	phi = ed_minus_1

	s = N - phi + 1

	disc = s*s - 4*N
	if disc < 0:
		return None
	t = int(math.isqrt(disc))
	if t*t != disc:
		return None
	p = (s + t) // 2
	q = (s-t) //2
	if p*q ==N:
		return (p,q)
	return None


